svg.script:

var scale = 1.2; // 1.414213562;
/* Zoom in or out */
function zoomInOut(delta, mouseX, mouseY) {
	var strScale = document.getElementsByTagName('svg')[0].getAttribute('height');
	var curScale = strScale.replace('%', '').valueOf();
	var curMouseX = mouseX;
	var curMouseY = mouseY;
	var offsetL = (new window.scrollOffset()).x;
	var offsetT = (new window.scrollOffset()).y;
	if (delta >= 0) { // zoomIn()
		if (curScale > 10000) return;
		curScale *= scale;
	} else { // zoomOut()
		if (curScale < 1) return;
		curScale /= scale;
	}
	// zoom
	document.getElementsByTagName('svg')[0].setAttribute('height', (curScale.toString() + '%'));
	document.getElementsByTagName('svg')[0].setAttribute('width', (curScale.toString() + '%'));
	// correct position around mouse point
	if (delta >= 0) {
		window.scrollBy((curMouseX+offsetL)*(scale - 1),(curMouseY+offsetT)*(scale - 1));
	} else {
		window.scrollBy(-(curMouseX+offsetL)*(scale - 1)/scale,-(curMouseY+offsetT)*(scale - 1)/scale);
	}
}
/* Wheel event for zoom action */
function wheel(event){
	var delta = 0;
	if (!event) event = window.event;
	if (event.wheelDelta) {
		delta = event.wheelDelta/120; 
		if (window.opera) delta = -delta;
	} else if (event.detail) {
		delta = -event.detail/3;
	}
	if (delta) zoomInOut(delta, event.clientX, event.clientY);
    if (event.preventDefault) event.preventDefault();
    event.returnValue = false;
}
/* Initialization code. */
if (window.addEventListener) {
	window.addEventListener('DOMMouseScroll', wheel, false);
}
window.onmousewheel = document.onmousewheel = wheel;
/* Current x/y scroll offset of the window
   example use: var vertical_win_scroll = (new window.scrollOffset()).y; */
window.scrollOffset = function(parent) {
	this.x = 0;
	this.y = 0;
	var doc = parent ? parent.document : document;
	var win = parent ? parent.window : window;
	if (doc.documentElement && doc.documentElement.scrollTop) {
		this.y = doc.documentElement.scrollTop;
		this.x = doc.documentElement.scrollLeft;
	} else if (doc.body) {
		this.y = doc.body.scrollTop;
		this.x = doc.body.scrollLeft;
	} else if (win.innerHeight) {
		this.y = win.pageYOffset;
		this.x = win.pageXOffset;
	}
}
